--
-- Name: compare_experiments(integer, integer); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.compare_experiments(exp1_id integer, exp2_id integer) RETURNS TABLE(scenario character varying, exp1_f1 double precision, exp2_f1 double precision, improvement double precision)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    COALESCE(er1.scenario, er2.scenario) as scenario,
    er1.f1_score as exp1_f1,
    er2.f1_score as exp2_f1,
    CASE
      WHEN er1.f1_score IS NOT NULL AND er1.f1_score > 0
      THEN ((er2.f1_score - er1.f1_score) / er1.f1_score * 100)
      ELSE NULL
    END as improvement
  FROM experiment_results er1
  FULL OUTER JOIN experiment_results er2
    ON er1.scenario = er2.scenario
    AND er2.experiment_id = exp2_id
  WHERE er1.experiment_id = exp1_id OR er2.experiment_id = exp2_id
  ORDER BY scenario;
END;
$$;


ALTER FUNCTION public.compare_experiments(exp1_id integer, exp2_id integer) OWNER TO unified_memory;

--
-- Name: get_best_experiment(character varying); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.get_best_experiment(scenario_filter character varying DEFAULT NULL::character varying) RETURNS TABLE(experiment_id integer, experiment_name character varying, avg_f1_score double precision, config jsonb)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    e.id,
    e.name,
    AVG(er.f1_score) as avg_f1,
    e.config
  FROM experiments e
  JOIN experiment_results er ON e.id = er.experiment_id
  WHERE scenario_filter IS NULL OR er.scenario = scenario_filter
  GROUP BY e.id, e.name, e.config
  ORDER BY avg_f1 DESC
  LIMIT 1;
END;
$$;


