-- Name: get_best_experiment_for_paper(character varying); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.get_best_experiment_for_paper(paper_id_filter character varying) RETURNS TABLE(experiment_id integer, experiment_name character varying, avg_f1_score double precision)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    e.id,
    e.name,
    AVG(er.f1_score) as avg_f1
  FROM experiments e
  JOIN experiment_results er ON e.id = er.experiment_id
  JOIN experiment_papers ep ON e.id = ep.experiment_id
  WHERE ep.paper_id = paper_id_filter
  GROUP BY e.id, e.name
  ORDER BY avg_f1 DESC
  LIMIT 1;
END;
$$;


