-- Name: get_next_paper_id(); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.get_next_paper_id() RETURNS character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
  max_id VARCHAR(10);
  next_num INTEGER;
BEGIN
  SELECT id INTO max_id
  FROM papers
  ORDER BY id DESC
  LIMIT 1;

  IF max_id IS NULL THEN
    RETURN '001';
  END IF;

  next_num := CAST(max_id AS INTEGER) + 1;
  RETURN LPAD(next_num::TEXT, 3, '0');
END;
$$;


