CREATE FUNCTION public.get_papers_by_status(status_filter character varying DEFAULT NULL::character varying) RETURNS TABLE(id character varying, title character varying, priority character varying, expected_f1_gain double precision, experiment_count bigint)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    p.id,
    p.title,
    p.priority,
    p.expected_f1_gain,
    COUNT(ep.experiment_id) as exp_count
  FROM papers p
  LEFT JOIN experiment_papers ep ON p.id = ep.paper_id
  WHERE status_filter IS NULL OR p.status = status_filter
  GROUP BY p.id, p.title, p.priority, p.expected_f1_gain
  ORDER BY
    CASE p.priority
      WHEN 'high' THEN 1
      WHEN 'medium' THEN 2
      WHEN 'low' THEN 3
    END,
    p.expected_f1_gain DESC NULLS LAST;
END;
$$;


