-- Name: search_chunks_by_embedding(public.vector, double precision, integer, character varying); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.search_chunks_by_embedding(query_embedding public.vector, similarity_threshold double precision DEFAULT 0.7, result_limit integer DEFAULT 10, filter_method character varying DEFAULT NULL::character varying) RETURNS TABLE(id character varying, canonical_object_id character varying, content text, method character varying, metadata jsonb, similarity double precision)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    c.id,
    c.canonical_object_id,
    c.content,
    c.method,
    c.metadata,
    1 - (c.embedding <=> query_embedding) AS similarity
  FROM chunks c
  WHERE
    c.embedding IS NOT NULL
    AND (filter_method IS NULL OR c.method = filter_method)
    AND (1 - (c.embedding <=> query_embedding)) >= similarity_threshold
  ORDER BY c.embedding <=> query_embedding
  LIMIT result_limit;
END;
$$;


ALTER FUNCTION public.search_chunks_by_embedding(query_embedding public.vector, similarity_threshold double precision, result_limit integer, filter_method character varying) OWNER TO unified_memory;

