--
-- Name: search_memories(public.vector, double precision, integer, character varying, text[]); Type: FUNCTION; Schema: public; Owner: unified_memory
--

CREATE FUNCTION public.search_memories(query_embedding public.vector, match_threshold double precision DEFAULT 0.7, match_count integer DEFAULT 10, filter_platform character varying DEFAULT NULL::character varying, filter_tags text[] DEFAULT NULL::text[]) RETURNS TABLE(id uuid, content text, metadata jsonb, tags text[], platform character varying, similarity double precision, created_at timestamp with time zone)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN QUERY
  SELECT
    m.id,
    m.content,
    m.metadata,
    m.tags,
    m.platform,
    1 - (m.embedding <=> query_embedding) AS similarity,
    m.created_at
  FROM memories m
  WHERE
    -- Similarity threshold filter
    1 - (m.embedding <=> query_embedding) > match_threshold
    -- Optional platform filter
    AND (filter_platform IS NULL OR m.platform = filter_platform)
    -- Optional tags filter (array overlap)
    AND (filter_tags IS NULL OR m.tags && filter_tags)
  ORDER BY m.embedding <=> query_embedding
  LIMIT match_count;
END;
$$;


