linear|tenxai|issue|TEN-266	linear	issue	[Layer 7 - Consolidation] Cold storage migration to S3 Glacier	## Owner: Person A\n\n## Depends On: Consolidation scheduler (TEN-254), S3 bucket setup\n\n## Parallel Work: Person B can work on reasoning layer\n\n## Goal\n\nMigrate old events from PostgreSQL to S3 Glacier for cost-effective long-term storage\n\n## Detailed Tasks\n\n- [ ] Create `ColdStorageService` class with methods:\n  - `migrateToGlacier(objectId, cutoffDate)` - Migrate old events\n  - `retrieveFromGlacier(objectId, version)` - Retrieve archived events\n  - `listArchivedEvents(objectId)` - List events in cold storage\n- [ ] Define cold storage criteria:\n  - Events older than 180 days\n  - Objects with > 100 events (keep recent 50, archive rest)\n  - Objects marked as completed/closed\n- [ ] Implement migration workflow:\n  1. Query PostgreSQL `events` table for old events\n  2. Group events by canonical_object_id\n  3. Compress as JSON (gzip)\n  4. Upload to S3: `cold-storage/events/{year}/{month}/{object_id}_{version_range}.json.gz`\n  5. Mark events as archived in PostgreSQL (add `archived_at`, `archive_s3_key`)\n  6. Optionally: Delete from PostgreSQL (or keep metadata only)\n- [ ] Implement Glacier retrieval:\n  - Initiate Glacier retrieval (takes 3-5 hours for standard)\n  - Use Glacier Flexible Retrieval for balance of cost/speed\n  - Cache retrieved data temporarily\n  - Notify when retrieval complete\n- [ ] Update canonical_objects table:\n\n  ```sql\n  ALTER TABLE canonical_objects ADD COLUMN cold_storage_keys JSONB;\n  -- Store array of S3 keys for archived events\n  ```\n- [ ] Implement cold storage scheduler:\n  - Run weekly to identify objects to archive\n  - Run migration in batches (avoid overwhelming DB)\n  - Log migration statistics\n- [ ] Add cold storage dashboard:\n  - Show how much data is in cold storage\n  - Cost savings vs hot storage\n  - Retrieval requests\n- [ ] Implement hybrid queries:\n  - If user queries archived object, check if cold retrieval needed\n  - Show summary from hot storage immediately\n  - Retrieve full history from Glacier on demand\n- [ ] Write tests for migration and retrieval\n\n## Acceptance Criteria\n\n* Old events are migrated to Glacier\n* Migration runs on schedule\n* Can retrieve from Glacier when needed\n* Cost savings are measurable\n* Tests pass\n\n## References\n\n[claude.md](http://claude.md) lines 153-160 - Consolidation with cold storage	\N	{"created_by": "user:cailynyongyong@gmail.com"}	{"created_at": "2025-11-22T05:45:17.745Z", "updated_at": "2025-11-22T05:45:17.745Z"}	\N	{"url": "https://linear.app/tenxai/issue/TEN-266/layer-7-consolidation-cold-storage-migration-to-s3-glacier", "status": "Triage", "team_id": "6f5c4b05-21d3-4824-b18d-b325e87dace1"}	\N	[Layer 7 - Consolidation] Cold storage migration to S3 Glacier ## Owner: Person A\n\n## Depends On: Consolidation scheduler (TEN-254), S3 bucket setup\n\n## Parallel Work: Person B can work on reasoning layer\n\n## Goal\n\nMigrate old events from PostgreSQL to S3 Glacier for cost-effective long-term storage\n\n## Detailed Tasks\n\n- [ ] Create `ColdStorageService` class with methods:\n  - `migrateToGlacier(objectId, cutoffDate)` - Migrate old events\n  - `retrieveFromGlacier(objectId, version)` - Retrieve archived events\n  - `listArchivedEvents(objectId)` - List events in cold storage\n- [ ] Define cold storage criteria:\n  - Events older than 180 days\n  - Objects with > 100 events (keep recent 50, archive rest)\n  - Objects marked as completed/closed\n- [ ] Implement migration workflow:\n  1. Query PostgreSQL `events` table for old events\n  2. Group events by canonical_object_id\n  3. Compress as JSON (gzip)\n  4. Upload to S3: `cold-storage/events/{year}/{month}/{object_id}_{version_range}.json.gz`\n  5. Mark events as archived in PostgreSQL (add `archived_at`, `archive_s3_key`)\n  6. Optionally: Delete from PostgreSQL (or keep metadata only)\n- [ ] Implement Glacier retrieval:\n  - Initiate Glacier re