linear|tenxai|issue|TEN-265	linear	issue	[Infrastructure] Raw data backup pipeline to S3	## Owner: Person A\n\n## Depends On: S3 bucket setup, Notion/GitHub APIs\n\n## Parallel Work: Person B can work on any Layer 3-8 tasks\n\n## Goal\n\nImplement pipeline to backup raw API responses to S3 for disaster recovery\n\n## Detailed Tasks\n\n- [ ] Create `BackupService` class with methods:\n  - `backupNotionPage(pageId, rawResponse)` - Backup raw Notion data\n  - `backupGitHubIssue(owner, repo, number, rawResponse)` - Backup raw GitHub data\n  - `backupGitHubCommit(owner, repo, sha, rawResponse)` - Backup raw commit data\n  - `listBackups(platform, date)` - List available backups\n  - `retrieveBackup(s3Key)` - Retrieve backup for reprocessing\n- [ ] Implement backup during sync:\n  - After fetching from API, save raw JSON to S3 before transformation\n  - S3 key format: `raw-backups/{platform}/{YYYY-MM-DD}/{object_type}_{id}.json.gz`\n  - Compress with gzip to reduce storage costs\n- [ ] Add metadata to backups:\n  - Store metadata tags on S3 objects:\n    - `platform`: notion/github\n    - `object_type`: page/issue/pr/commit\n    - `fetched_at`: timestamp\n    - `api_version`: for tracking API changes\n- [ ] Implement incremental backups:\n  - Only backup if object changed (check etag/last_modified)\n  - Skip if already backed up with same content\n- [ ] Add backup verification:\n  - After upload, verify file exists and size matches\n  - Periodic integrity checks (sample random backups)\n- [ ] Implement backup retention policy:\n  - Keep raw backups for 90 days in S3 Standard\n  - Transition to S3 Standard-IA after 30 days\n  - Transition to Glacier after 90 days\n  - Delete after 1 year (configurable)\n- [ ] Create reprocessing capability:\n  - `reprocessBackup(s3Key)` - Fetch backup and re-transform\n  - Useful if transformation logic changes\n  - Useful for disaster recovery\n- [ ] Add backup monitoring:\n  - Dashboard showing backup coverage\n  - Alert on backup failur