linear|tenxai|issue|TEN-264	linear	issue	[Infrastructure] Attachment download and S3 upload pipeline	## Owner: Person A\n\n## Depends On: S3 bucket setup, Notion/GitHub content extraction\n\n## Parallel Work: Person B can work on embedding layer\n\n## Goal\n\nBuild pipeline to download attachments from Notion/GitHub and store securely in S3\n\n## Detailed Tasks\n\n- [ ] Create `AttachmentService` class with methods:\n  - `downloadAttachment(url, metadata)` - Download file from URL\n  - `uploadToS3(file, s3Key)` - Upload to S3\n  - `getPresignedUrl(s3Key, expiresIn)` - Generate temporary access URL\n  - `deleteAttachment(s3Key)` - Delete from S3\n- [ ] Implement Notion attachment handling:\n  - Extract attachment URLs from Notion pages\n  - Download files (respect rate limits)\n  - **Problem**: Notion URLs expire after \\~1 hour\n  - **Solution**: Download and store in S3 immediately during sync\n  - Generate stable S3 keys: `attachments/notion/{workspace}/{page_id}/{filename}`\n- [ ] Implement GitHub attachment handling:\n  - Download images/files from issues/PRs\n  - Handle GitHub's asset CDN URLs\n  - Generate S3 keys: `attachments/github/{owner}/{repo}/issues/{number}/{filename}`\n- [ ] Update canonical_objects schema:\n  - Store both original URL and S3 location\n\n  ```json\n  "attachments": [\n    {\n      "id": "att_123",\n      "type": "pdf",\n      "name": "design.pdf",\n      "original_url": "https://notion.so/...",\n      "s3_bucket": "unified-memory-attachments",\n      "s3_key": "attachments/notion/ws/page/design.pdf",\n      "size_bytes": 1048576,\n      "uploaded_at": "2024-11-22T10:00:00Z"\n    }\n  ]\n  ```\n- [ ] Implement batch download for efficiency:\n  - Queue attachments for download\n  - Process in parallel (rate limited)\n  - Handle failures and retries\n- [ ] Add virus scanning (optional but recommended):\n  - Scan files before uploading to S3\n  - Use AWS Malware Scanner or ClamAV\n- [ ] Handle duplicate files:\n  - Check if file already exists in S3 (by hash)\n  - Skip download if duplicate\n- [ ] Implement presigned URL generation:\n  - Generate URLs that expire in 1 hour\n  - Return to API consumers for temporary access\n- [ ] Add metrics and monitoring:\n  - Count of attachments downloaded\n  - Failed downloads\n  - S3 upload errors\n- [ ] Write integration tests\n\n## Acceptance Criteria\n\n* Attachments are downloaded from Notion/GitHub\n* Files are uploaded to S3 with correct structure\n* S3 keys are stored in canonical_objects\n* Presigned URLs can be generated\n* Duplicate handling works\n* Tests pass\n\n## References\n\n[claude.md](http://claude.md) lines 29-39 - Attachments structure	\N	{"created_by": "user:cailynyongyong@gmail.com"}	{"created_at": "2025-11-22T05:45:12.338Z", "updated_at": "2025-11-22T05:45:12.338Z"}	\N	{"url": "https://linear.app/tenxai/issue/TEN-264/infrastructure-attachment-download-and-s3-upload-pipeline", "status": "Triage", "team_id": "6f5c4b05-21d3-4824-b18d-b325e87dace1"}	\N	[Infrastructure] Attachment download and S3 upload pipeline ## Owner: Person A\n\n## Depends On: S3 bucket setup, Notion/GitHub content extraction\n\n## Parallel Work: Person B can work on embedding layer\n\n## Goal\n\nBuild pipeline to download attachments from Notion/GitHub and store securely in S3\n\n## Detailed Tasks\n\n- [ ] Create `AttachmentService` class with methods:\n  - `downloadAttachment(url, metadata)` - Download file from URL\n  - `uploadToS3(file, s3Key)` - Upload to S3\n  - `getPresignedUrl(s3Key, expiresIn)` - Generate temporary access URL\n  - `deleteAttachment(s3Key)` - Delete from S3\n- [ ] Implement Notion attachment handling:\n  - Extract attachment URLs from Notion pages\n  - Download files (respect rate limits)\n  - **Problem**: Notion URLs expire after \\~1 hour\n  - **Solution**: Download and store in S3 immediately during sync\n  - Generate stable S3 keys: `attachments/notion/{workspace}/{page_id}/{filename}`\n- [ ] Implement GitHub attachment handling:\n  - Download